import { useState } from "react";
import ButtonsSelector from "../../utils/components/ButtonsSelector";

function Home() {

	const [selected, setSelected] = useState(null);

	return (
		<>
			<ButtonsSelector buttons={["Section 1", "Section 2"]} selected={selected} setSelected={setSelected} />
			{selected === 0 && "section 1"}
			{selected === 1 && "section 2"}
		</>
	);
}

export default Home;
